import './App.css';
import imageImport from './fortune-teller.jpg';
import axios from "axios";
import {useEffect, useState} from 'react';

function App() {
const [adjective, setAdjective] = useState("text")
const [noun, setNoun] = useState("text")

const fetchData2 = async () => {
  const response = await axios.get('https://namelist.herokuapp.com/namelist');
  // const json = await response.json();
  console.log("here", response.data[0].adjective, "length", response.data[0].adjective.length);// setMessage(response.data.message)
// setMessage(response.data[0].adjective)
setAdjective(response.data[0].adjective[Math.floor((Math.random() * response.data[0].adjective.length))])
}

useEffect(() => {
  // fetchData(); 
  fetchData2()
}, [])


  return (
    <div className="App">
      <header className="App-header">
        <img src={imageImport} className="fortuneTeller" alt="fortune-teller" />
        <p>
{adjective}  {noun}      </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
